document.addEventListener("DOMContentLoaded", function () {
    window.cy = cytoscape({
        container          : document.getElementById("cy"),
        layout             : {name: "preset"},
        selectionType      : "single",
        boxSelectionEnabled: true,
        pixelRatio         : 1,
        wheelSensitivity   : 0.4,
        minZoom            : 0.25,
        maxZoom            : 4,
        elements           : DATA,
        style              : [
            {selector: "node", style: {"font-weight": 700, "text-valign": "center"}},
            {selector: "node[t='SARS2']", style: {width: 150, height: 150, "font-size": "36px", "color": "#fff", "background-color": "#434a54", label: "data(l)", shape: "diamond"}},
            {selector: "node[t='HOST']", style: {width: 25, height: 25, "font-size": "24px", "color": "#000", "background-color": "#fea555"}},
            {selector: "node:selected", style: {"border-width": "6px", "border-color": "#3bf"}},
            {selector: "edge", style: {width: 2, opacity: 0.5}},
            {selector: "edge[t='APMS']", style: {"line-color": "#eb8dac"}},
            {selector: "edge[t='APMS;Y2H']", style: {"line-color": "#9d84dc"}},
            {selector: "edge[t='Y2H']", style: {"line-color": "#70b1bb"}},
            {selector: "edge.label", style: {"line-color": "#3bf", "opacity": 0.8}},
            {selector: 'node.label', style: {label: "data(l)", "border-width": "6px", "border-color": "#3bf"}},
        ],
    });
    window.cy.fit();
    window.cy.on("select", "node", function (evt) {
        var node = evt.target;
        var neighbors = [];
        node.addClass("label");
        node.neighborhood().addClass("label").forEach((ele, i) => {if (ele.isNode()) neighbors.push(ele.data("l"));});
        node.connectedEdges().addClass("label");
        document.getElementById("info").innerHTML = "Selected node: " + node.data("l") + "<br><br>Neighbors:<br>" + neighbors.join("<br>");
    });
    window.cy.on("unselect", "node", function (evt) {
        var node = evt.target;
        node.removeClass("label");
        node.neighborhood().removeClass("label");
        node.connectedEdges().removeClass("label");
        document.getElementById("info").innerHTML = "";
    });
    document.getElementById("cover").style.display = "none";
});
